import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import "./App.css";
// import Arr from "./Arr";
import Arr2 from "./Arr2";
import Card from "./Card";


function App() {

  return (
    <Aux>
    {
      Arr2.map( (val) => {
        return(
          <Card key = {val.id} 
          head1 = {val.title}
          imgsrc = {val.src} />
        );
      }  )
    }
    </Aux>
  );
}

export default App;
